import logo from "./logo.svg";
import "./App.css";
import React from "react";
import Generator from "./Generator";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Generate Your Colorado Business Name!</h1>!
        <Generator />
      </header>
      <Generator />
    </div>
  );
}

export default App;
